import React from 'react'

export default function WorkoutPage(props) {


const opneWorkout = () =>{}
// true/false

  return (
    <div>
        <button className='workoutButton'  onClick ={opneWorkout} disabled ={props.workouts.isDone}>
            <h4>Workout N.O {props.workouts.wNumber}</h4>
            <p>{props.workouts.km} KM </p>
        </button>
    </div>
  )
}
